import React from "react";
import "./Home.css";
import { Link, useLocation } from "react-router-dom";
import { Container, Col, Row } from "react-bootstrap";
import logoIMG from "../Resources/RC_LOGO.png";

function Home() {
  const { pathname } = useLocation();

  // var OiaPic = document.getElementById("OiaImage");
  // OiaPic.src = "src/Pictures/Renke_at_Oia.jpg";

  return (
    <section className="home-page">
      <Container>
        <header className="header">
          <Row>
            <Col>
              <div className="RCLOGO">
                <Link to="/Home">
                  <img src={logoIMG} alt="Renke Cui Logo"></img>
                </Link>
              </div>
            </Col>
            <Col>
              <div className="btnProjects">
                <Link
                  to="/Projects"
                  className={`nav-link ${
                    pathname.includes("Projects") ? "active" : ""
                  }`}
                >
                  Projects
                </Link>
              </div>
            </Col>
            <Col>
              <div className="btnAbout">
                <Link
                  to="/About"
                  className={`button text-wrapper-3${
                    pathname.includes("About") ? "active" : ""
                  }`}
                >
                  About Me
                </Link>
              </div>
            </Col>
          </Row>
        </header>
        <content></content>
      </Container>
    </section>
  );
}

export default Home;
